CHOOSE_GLYPHS = "Wählt Eure Glyphen.";
CHOOSE_GLYPHS_HELP = "Auf der Maximalstufe habt Ihr die Wahl zwischen drei erheblichen und drei geringen Glyphen. Erhebliche Glyphen ändern die Art und Weise, wie einige Eurer Zauber oder Fähigkeiten funktionieren, während geringe Glyphen kosmetische oder kleinere praktische Veränderungen mit sich bringen.\n\nIhr müsst eine Glyphe erlernen, bevor Ihr sie auswählen könnt. Glyphen werden von Spielercharakteren mit dem Beruf Inschriftenkunde hergestellt. Ihr könnt sie erhalten, indem Ihr mit einem anderen Spieler handelt oder das Auktionshaus besucht.\n\nIhr könnt Eure Glyphen zurücksetzen lassen, indem Ihr einen Lehrer für Eure Klasse aufsucht. Ihr könnt auch einzelne Glyphen zurücksetzen, indem Ihr einen Gegenstand namens %s verwendet.";
CHOOSE_GLYPHS_NOW = "Ihr könnt nun Glyphen für Euren Charakter wählen.";
