CHOOSE_PET_ABILITY = "Wählt eine Fähigkeit";
CHOOSE_RAID = "Schlachtzug wählen";
CHOOSE_SPECIALIZATION = "Wählt Eure Spezialisierung.";
CHOOSE_SPECIALIZATION_HELP = "Ihr könnt nun eine Spezialisierung für Euren Charakter wählen. Spezialisierungen gewähren auf Stufe 10 sowie höheren Stufen neue Fähigkeiten. Die meisten Spezialisierungen nutzen unterschiedliche Angriffe oder Zauber, als andere Spezialisierungen der gleichen Klasse.\n\nEinige Spezialisierungen gestatten es Euch, verschiedene Rollen, wie Tank oder Heiler, auszufüllen. Ihr könnt Eure Spezialisierung wechseln, indem Ihr den Lehrer für Eure Klasse aufsucht.";
CHOOSE_SPECIALIZATION_NOW = "Ihr könnt nun eine neue Spezialisierung für Euren Charakter wählen.";
CHOOSE_STATIONERY = "Briefpapier wählen.";
CHOOSE_TALENTS = "Wählt Eure Talente.";
CHOOSE_TALENTS_HELP = "Talente sind spezielle Fähigkeiten, von denen einige aktive Angriffe oder Zauber sind, die auf die Aktionsleiste gelegt werden können, während andere passive Effekte sind.\n\nEs gibt eigentlich keine richtigen und falschen Talente für Euren Charakter. Die Wahl sollte danach getroffen werden, was Euch als unterhaltsam erscheint und Euren Spielstil unterstützt. Jedes Mal, wenn Ihr ein Talent wählen könnt, habt Ihr die Wahl zwischen drei verschiedenen Optionen.\n\nIhr könnt Eure Talente zurücksetzen lassen, indem Ihr einen Lehrer für Eure Klasse aufsucht. Ihr könnt auch neue Talente in einer einzelnen Reihe auswählen, indem Ihr einen Gegenstand namens %s verwendet.";
CHOOSE_TALENTS_NOW = "Ihr könnt nun Talente für Euren Charakter wählen.";
CHOOSE_THE_ALLIANCE = "Die edlen Völker der Allianz verbindet ein Band stolzer Traditionen von Großmut, Ehre, Treue, Gerechtigkeit und Hingabe.\n\nOb durch technische, arkane oder spirituelle Weisheit - alle Mitglieder der Allianz tragen ihren Teil zu einer friedlichen und gerechten Welt bei.\n\nTretet der Allianz bei, um für ihre hehren Ideale in ganz Azeroth und darüber hinaus einzustehen.";
CHOOSE_THE_HORDE = "Die stolzen Völker der Horde stellen einen losen Zweckverbund gegen eine Welt dar, die sie am liebsten vernichten würde.\n\nDie zielorientierte und ungestüme Horde schätzt Stärke und Ehre, hat aber bisweilen mit ihrer eigenen Aggression zu kämpfen.\n\nSchließt Euch der Horde an, um für eine Welt zu kämpfen, in der ihre Völker frei leben können.";
