HELPFRAME_REPORT_ABUSE_HELP = "Die Sicherheit und das Wohlergehen unserer Spieler ist uns extrem wichtig. Sollten Sie den Eindruck haben, dass sich ein Spieler Ihnen oder anderen gegenüber in einer beleidigenden Art und Weise verhält, oder einen Charakternamen führt, der unsere Nutzungsbestimmungen verletzt, steht Ihnen eine unkomplizierte Funktion zu Verfügung, um uns Ihr Anliegen zu übermitteln. Sie können einen Spieler auf schnelle und einfache Weise melden, indem Sie im Chatfenster mit der rechten Maustaste seinen Charakternamen anklicken und dann die Option \"Spieler melden\" wählen.";
HELPFRAME_REPORT_BUG_TEXT1 = "Wenn Sie auf einen Bug gestoßen sind, werden wir so viele Details wie möglich brauchen, um ihn zu finden und zu beheben. Beschreiben Sie bitte im unteren Feld das Problem:\n\n-|cffffd200Machen Sie genaue Angaben|r über jeden Schritt, der zu dem Problem führt.\n-Erwähnen Sie alle relevanten |cffffd200Charakternamen, NSCs und Orte|r.\n-|cffffd200Vermeiden Sie Schreibfehler und Abkürzungen|r, da sie das Finden des Bugs erschweren.\n-Geben Sie an, |cffffd200seit wann|r Ihnen das Problem bekannt ist und |cffffd200wie oft|r sie es gesehen haben (falls mehr als ein Mal).";
