HELPFRAME_REPORT_PLAYER_TEXT1 = "World of Warcraft soll eine unterhaltsame, faire und sichere Umgebung bieten. Wenn Sie einem Spieler begegnen, der einen |cffffd200regelwidrigen Charakternamen|r verwendet, den Chat mit |cffffd200Spam|r beeinträchtigt, |cffffd200Cheats nutzt|r oder durch |cffffd200unangemessene Ausdrucksweise|r auffällt, gibt es eine schnelle und leichte Art, das Problem an Blizzard weiterzureichen, damit der Sachverhalt überprüft werden kann.\n\nUm einen Spieler wegen Verstoßes gegen die Regeln oder unangemessenen Verhaltens zu melden, |cffffd200klicken Sie mit der rechten Maustaste auf den Namen des Spielercharakters|r, der im Chat angezeigt wird, oder |cffffd200klicken Sie mit der rechten Maustaste auf das Portrait des Spielercharakters|r und wählen Sie die Option |cffffd200Spieler melden|r.";
