HELPFRAME_SUBMIT_SUGGESTION_LEGAL = "Indem Sie auf |cffffd200Senden|r klicken, bestätigen Sie, dass die eingesandte Idee ausschließlich Ihre eigene ist, und räumen Blizzard Entertainment das Recht ein, sie auf jedwede Art zu verwenden, ohne dass ein Vergütungsanrecht Ihrerseits besteht.";
