NEWBIE_TOOLTIP_HONORABLE_KILLS = "Wenn Ihr oder Eure Gruppe im PvP einem gegnerischen Charakter Schaden zufügt und dieser anschließend besiegt wird, erhaltet Ihr einen ehrenhaften Sieg. Der ehrenhafte Sieg wird Euch nur angerechnet, wenn das Ziel als grün oder stärker eingestuft wurde (Das Ziel würde Euch, genau wie ein Gegner mit diesem Schwierigkeitsgrad, Erfahrungspunkte einbringen). Nur das Besiegen von Charakteren der gegnerischen Fraktion gewährt Euch einen ehrenhaften Sieg.";
