TOL_BARAD_DESCRIPTION = "Tol Barad, einst eine mächtige Inselzitadelle von Stromgarde, wurde von brandschatzenden Orcs dem Erdboden gleichgemacht und lag daraufhin brach. Jahre später wurde die Insel von Kul Tiras wieder beansprucht, und eine Gruppe Magier leitete den Bau eines gigantischen magischen Gefängnisses, das auf den Ruinen der Festung errichtet wurde.\n\nIn einer groß angelegten Schlacht muss das angreifende Team gleichzeitig die Eiserne Garnison, die Hüterwacht und die Erzraffinerie kontrollieren, um den Sieg zu erringen. Die angreifende Streitmacht kann zurückgelassene Belagerungsmaschinen benutzen, um die drei Wachtürme zu zerstören und die Dauer der Schlacht zu verlängern.";
