TUTORIAL57_TROLL_HUNTER = "Denkt daran, zu |cffffd200Ortezza|r zurückzukehren. Sie hat eine Quest für Euch! |cffffd200Klickt mit der rechten Maustaste|r auf sie, wenn Euer Mauszeiger zu einem |cffffd200gelben Fragezeichen|r wird.";
