TUTORIAL57_TROLL_ROGUE = "Denkt daran, zu |cffffd200Legati|r zurückzukehren. Er hat eine Quest für Euch! |cffffd200Klickt mit der rechten Maustaste|r auf ihn, wenn Euer Mauszeiger zu einem |cffffd200gelben Fragezeichen|r wird.";
TUTORIAL57_TROLL_SHAMAN = "Denkt daran, zu |cffffd200Nekali|r zurückzukehren. Sie hat eine Quest für Euch! |cffffd200Klickt mit der rechten Maustaste|r auf sie, wenn Euer Mauszeiger zu einem |cffffd200gelben Fragezeichen|r wird.";
TUTORIAL57_TROLL_WARLOCK = "Denkt daran, zu |cffffd200Voldreka|r zurückzukehren. Er hat eine Quest für Euch! |cffffd200Klickt mit der rechten Maustaste|r auf ihn, wenn Euer Mauszeiger zu einem |cffffd200gelben Fragezeichen|r wird.";
TUTORIAL57_TROLL_WARRIOR = "Denkt daran, zu |cffffd200Nortet|r zurückzukehren. Er hat eine Quest für Euch! |cffffd200Klickt mit der rechten Maustaste|r auf ihn, wenn Euer Mauszeiger zu einem |cffffd200gelben Fragezeichen|r wird.";
TUTORIAL58 = "Eure Taschen sind voll, also werdet Ihr nicht in der Lage sein, noch mehr Beute aufzuheben. Um Taschenplatz freizumachen, besucht einen der Händler und verkauft ihm etwas von Euren unbenötigten Dingen.|n|nHändler gibt es für gewöhnlich in allen Dörfern, Städten oder Außenposten.";
TUTORIAL59 = "Um Taschenplatz freizumachen oder an etwas Geld zu kommen, könnt Ihr einige der Gegenstände verkaufen, die Ihr eingesammelt habt.|n|nSucht einen Händler auf und klickt mit |cffffd200der rechten Maustaste|r auf ihn. Dann öffnet Eure Taschen und klickt mit |cffffd200der rechten Maustaste|r auf Gegenstände, die Ihr verkaufen wollt.";
TUTORIAL5_DRUID = "Um einen Gegner zu bekämpfen, klickt auf Eurer |cffffd200Aktionsleiste|r die Fähigkeit |cffffd200Zorn|r an.";
TUTORIAL5_HUNTER = "Um einen Gegner zu bekämpfen, klickt auf Eurer |cffffd200Aktionsleiste|r die Fähigkeit |cffffd200Arkaner Schuss|r an.";
TUTORIAL5_MAGE = "Um einen Gegner zu bekämpfen, klickt auf Eurer |cffffd200Aktionsleiste|r die Fähigkeit |cffffd200Frostfeuerblitz|r an.";
TUTORIAL5_PALADIN = "Um einen Gegner zu bekämpfen, klickt auf Eurer |cffffd200Aktionsleiste|r die Fähigkeit |cffffd200Kreuzfahrerstoß|r an.";
TUTORIAL5_PRIEST = "Um einen Gegner zu bekämpfen, klickt auf Eurer |cffffd200Aktionsleiste|r die Fähigkeit |cffffd200Heilige Pein|r an.";
TUTORIAL5_ROGUE = "Um einen Gegner zu bekämpfen, klickt auf Eurer |cffffd200Aktionsleiste|r die Fähigkeit |cffffd200Finsterer Stoß|r an.";
TUTORIAL5_SHAMAN = "Um einen Gegner zu bekämpfen, klickt auf Eurer |cffffd200Aktionsleiste|r die Fähigkeit |cffffd200Blitzschlag|r an.";
TUTORIAL5_WARLOCK = "Um einen Gegner zu bekämpfen, klickt auf Eurer |cffffd200Aktionsleiste|r die Fähigkeit |cffffd200Schattenblitz|r an.";
TUTORIAL5_WARRIOR = "Um einen Gegner zu bekämpfen, klickt auf Eurer |cffffd200Aktionsleiste|r die Fähigkeit |cffffd200Angreifen|r an.";
TUTORIAL6 = "Viele Eurer Fähigkeiten sind Angriffe mit Waffen oder Kampfzauber.|n|nAbhängig von der Klasse Eures Charakters habt Ihr gegebenenfalls auch Verteidigungsfähigkeiten oder sogar Heilzauber auf Eurer Aktionsleiste.";
TUTORIAL60 = "Erinnert Euch daran, dass Euer Charakter spezielle Fähigkeiten hat, die Euch auf der Aktionsleiste am unten Rand des Bildschirms zur Verfügung stehen.|n|nWenn Ihr diese Fähigkeiten nutzt, werdet Ihr Gegner wesentlich schneller bezwingen können, als mit dem einfachen Schwingen der Waffe.";
TUTORIAL61_DRUID = "Als Druide könnt Ihr |cffffd200Eure Gestalt verändern|r und verschiedene Formen annehmen, die jede einzigartige Fähigkeiten und Ressourcen mit sich bringt. Eure erste Verwandlung, die Katzengestalt, erhöht Euren Nahkampfschaden.";
TUTORIAL61_HUNTER = "Ihr verfügt nun über eine |cffffd200Begleiteraktionsleiste|r, die Euch mehr Kontrolle über Euren Begleiter gibt. Darüber hinaus verfügt Ihr über die Fähigkeit '|cffffd200Wildtier zähmen|r', um neue Begleiter zu gewinnen.";
TUTORIAL61_PALADIN = "Ihr könnt jetzt |cffffd200heilige Kraft|r benutzen. Euer 'Kreuzfahrerstoß' erzeugt heilige Kraft, die Ihr mit 'Wort der Herrlichkeit' verbrauchen könnt.";
TUTORIAL61_ROGUE = "Ihr erzeugt nun mittels 'Finsterer Stoß' |cffffd200Combopunkte|r, die Ihr für mächtige |cffffd200Finishing-Moves |r einsetzen könnt, beispielsweise 'Ausweiden'.";
TUTORIAL61_SHAMAN = "Ihr habt Euer erstes |cffffd200Totem|r erlernt. Unterschiedliche Arten von Totems gewähren unterschiedliche Arten von Boni. Letztendlich wird es Euch möglich sein, vier verschiedene Totems zur gleichen Zeit zu benutzen.";
