TUTORIAL61_WARLOCK = "Ihr verfügt nun über eine |cffffd200Begleiteraktionsleiste|r, die Euch mehr Kontrolle über Euren Dämonen gibt. Es wird Euch möglich sein, verschiedene Arten von Dämonen für verschiedene Aufgaben zu beschwören.";
TUTORIAL61_WARRIOR = "Ihr habt eine neue |cffffd200Kampfhaltung|r erlernt. In Verteidigungshaltung verursacht Ihr weniger Schaden als in Kampfhaltung, dafür seid Ihr aber schwerer zu töten. Die Verteidigungshaltung ist am besten für die Tankrolle geeignet, da sie es Euch ermöglicht, andere Spielercharaktere zu schützen.";
TUTORIAL7 = "Wenn Ihr einen Gegner bezwingt wird durch ein Funkeln über dem Leichnam angezeigt, dass dort Beute zu holen ist. |n|n|cffffd200Klickt mit der rechten Maustaste|r auf den Leichnam, um ihn zu plündern. Dadurch wird das Beutefenster geöffnet.|n|nDann |cffffd200klickt mit der rechten Maustaste|r auf jeden Gegenstand, den Ihr in Eure Taschen packen möchtet.";
TUTORIAL8 = "In Eurem Rucksack befindet sich ein neuer Gegenstand.|n|nIhr könnt unten rechts im Bildschirm auf den |cffffd200Rucksack-Button|r klicken, um Euren Rucksack zu öffnen. Platziert den Mauszeiger über dem Gegenstand, um zu sehen, um was genau es sich handelt.";
TUTORIAL9 = "Manche Gegenstände können benutzt werden. |cffffd200Klickt mit der rechten Maustaste|r auf einen Gegenstand, um ihn zu nutzen.|n|nIhr könnt ihn auch auf Eure Aktionsleiste ziehen, falls Ihr ihn benutzen wollt ohne Euren Rucksack zu öffnen.";
