VOICEMACRO_19_Or_3_FEMALE = "Ihr seid in Ordnung. Gehen wir.";
VOICEMACRO_19_Or_4 = "Als ich Euch sah... dachte ich nicht, dass ich so weit kommen würde.";
VOICEMACRO_19_Or_4_FEMALE = "Nicht reden, folgt mir einfach.";
