VOICEMACRO_19_Sc_5 = "Stört Euch nicht an dem Sabber. Das ist nur Balsamierungsflüssigkeit.";
VOICEMACRO_19_Sc_5_FEMALE = "Ich muss mich nicht zu Tode lieben. Schon passiert.";
