VOICEMACRO_20_Or_5 = "Hört auf, mich zu pieken... Na ja, das war in Ordnung.";
VOICEMACRO_20_Or_5_FEMALE = "Ich glaub, das Eberfleisch kommt wieder hoch. Ich muss auf den Topf. Hat jemand 'n Ruhestein?";
VOICEMACRO_20_Sc_0 = "Ich kann den Geruch von Orcs nicht ertragen.";
VOICEMACRO_20_Sc_0_FEMALE = "Ich würde meine Zehennägel lackieren, wenn ich wüsste, wo sie abgefallen sind.";
VOICEMACRO_20_Sc_1 = "Ich bin tot und stinksauer.";
VOICEMACRO_20_Sc_1_FEMALE = "Ja, die sind echt. Sind nicht meine, aber sie sind echt.";
VOICEMACRO_20_Sc_2 = "Rosen sind grau, Veilchen sind grau. Ich bin tot und farbenblind, genau.";
VOICEMACRO_20_Sc_2_FEMALE = "Ich bin todunglücklich.";
